"use client"; 

import { createChart, ColorType } from 'lightweight-charts';
import React, { useState, useEffect, useRef } from 'react';

const ChartComponent = props => {
	const {
		data=initialData,
		className,
		colors: {
			backgroundColor = 'white',
			lineColor = '#2962FF',
			textColor = 'black',
			areaTopColor = '#2962FF',
			areaBottomColor = 'rgba(41, 98, 255, 0.28)',
		} = {},
		predictData=samplePredictedData,
	} = props;
	const allData = [...data, ...predictData];
	const [currentData, setCurrentData] = useState(null)
	const [isCurrentDataVisible, setCurrentDataVisible] = useState(true)
	const [chartType, setChartType] = useState('line')
	const chartContainerRef = useRef();
	const handleDataPanelCheckbox = event => {
		console.log("this is the value for the checkbox", event.target.checked)
		setCurrentDataVisible(event.target.checked)
	}
	const handleChartTypeInput = event => {
		let chartType = event.target.value;
		if (chartType !== 'area' && chartType !== 'candle'){
			chartType = 'line'
		}
		setChartType(chartType)
	}
	useEffect(
		() => {
			const handleResize = () => {
				chart.applyOptions({ width: chartContainerRef.current.clientWidth });
			};

			const chart = createChart(chartContainerRef.current, {
				layout: {
					background: { type: ColorType.Solid, color: backgroundColor },
					textColor,
				},
				width: chartContainerRef.current.clientWidth,
				height: 500,
			});
			chart.applyOptions({
				rightPriceScale: {
					visible: true,
				},
				leftPriceScale: {
					visible: true,
				},
			});
			chart.timeScale().fitContent();

			const priceSeries = chart.addLineSeries({ lineColor, topColor: areaTopColor, bottomColor: areaBottomColor, lineWidth: 3, priceScaleId: 'right', visible: chartType=='line'});
			priceSeries.setData(data.map(
				element => {
				return {'time': element['time'], 'value': element['close']}}));
			
			const candleSeries = chart.addCandlestickSeries(
				{ lineColor, topColor: areaTopColor, bottomColor: areaBottomColor, lineWidth: 2, visible: chartType==='candle'});
			candleSeries.setData(data.map(
				element => {
					return {
						...element, 'time': element['time']
					}
				}
			));
			const areaSeries = chart.addAreaSeries(
				{ lineColor, topColor: areaTopColor, bottomColor: areaBottomColor, lineWidth: 2, visible: chartType==='area'});
			areaSeries.setData(data.map(
				element => {
				return {'time': element['time'], 'value': element['close']}}));
			const volumeSeries = chart.addHistogramSeries({
				priceFormat: {
					type: 'volume',
				},
				priceScaleId: 'left',
			});
			volumeSeries.priceScale('left').applyOptions({
				scaleMargins: {
					top: 0.8, 
					bottom: 0,
				},
			});
			volumeSeries.setData(data.map(
				element => {
					return {
						'time': element['time'], 
						'value': element['volume'], 
						'color': element['change'] > 0 ? 'green': 'red'}
					}));

			const predictPriceSeries = chart.addLineSeries(
				{ lineColor: 'orange', topColor: areaTopColor, bottomColor: areaBottomColor, lineWidth: 2, visible: chartType==='line'});
			
			predictPriceSeries.setData([data.slice(-1)[0], ...samplePredictedData].map(
				element => {
				return {'time': element['time'], 'value': element['close'], 'color': 'orange'}}))
			
			const predictAreaSeries = chart.addAreaSeries(
				{ lineColor: 'orange', topColor: 'rgb(255, 213, 97)', bottomColor: 'rgb(242, 217, 148)', lineWidth: 2, visible: chartType==='area'});
			predictAreaSeries.setData([data.slice(-1)[0], ...samplePredictedData].map(
				element => {
				return {'time': element['time'], 'value': element['close']}}));

			const predictCandleSeries = chart.addCandlestickSeries(
				{ lineColor: 'orange', topColor: areaTopColor, bottomColor: areaBottomColor, lineWidth: 2, visible: chartType==='candle'});
			
			predictCandleSeries.setData(
				predictData.map(element => {
					return {
						...element
					}
				})
			)
			predictCandleSeries.setMarkers(
				predictData.map(element => {
					return {
						'time': element['time'],
						position: 'aboveBar',
						color: 'orange',
						shape: 'arrowDown',
						id: 'id4',
						text: 'Predict',
						size: 1,
					}
				})
			)
			const predictVolumeSeries = chart.addHistogramSeries({
				priceFormat: {
					type: 'volume',
				},
				priceScaleId: 'left',
			});
			predictVolumeSeries.priceScale('left').applyOptions({
				scaleMargins: {
					top: 0.8, 
					bottom: 0,
				},
			});
			predictVolumeSeries.setData(predictData.map(
				element => {
					return {
						'time': element['time'], 
						'value': element['volume'], 
						'color': 'orange'}
					}));
			
			chart.subscribeCrosshairMove((param) => {
				const datapoint = allData.find(point => point.time === param.time);
				if (datapoint && isCurrentDataVisible){
					console.log(datapoint);
					setCurrentData(datapoint);
				}
			});
				 

			window.addEventListener('resize', handleResize);

			return () => {
				window.removeEventListener('resize', handleResize);

				chart.remove();
			};
		},
		[data, isCurrentDataVisible, chartType, backgroundColor, lineColor, textColor, areaTopColor, areaBottomColor]
	);

	return (
		<div
			className={`${className} relative`}
			ref={chartContainerRef}
		>
			<nav className='w-full p-3 flex align-middle justify-center bg-white border-gray-200 dark:bg-gray-900'>
				<label class="relative inline-flex items-center cursor-pointer">
					<input type="checkbox" value="" class="sr-only peer" checked={isCurrentDataVisible} onChange={handleDataPanelCheckbox}/>
					<div class="w-11 h-6 bg-gray-200 rounded-full peer peer-focus:ring-4 peer-focus:ring-blue-300 dark:peer-focus:ring-blue-800 dark:bg-gray-700 peer-checked:after:translate-x-full peer-checked:after:border-white after:content-[''] after:absolute after:top-0.5 after:left-[2px] after:bg-white after:border-gray-300 after:border after:rounded-full after:h-5 after:w-5 after:transition-all dark:border-gray-600 peer-checked:bg-blue-600"></div>
					<span class="mx-3 text-sm font-medium text-gray-900 dark:text-gray-300">Show detail panel</span>
				</label>
				<label class="relative inline-flex items-center cursor-pointer">
					<select id="small" class="block text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" onChange={handleChartTypeInput}>
						<option value="line" selected>Line</option>
						<option value="candle">Candle</option>
						<option value="area">Area</option>
					</select>
					<span class="mx-3 text-sm font-medium text-gray-900 dark:text-gray-300">Chart type</span>
				</label>

			</nav>
			{isCurrentDataVisible && currentData && <div className='absolute top-5 left-[5%] z-40 p-3 bg-gray-400 bg-opacity-70 rounded-md w-40'>
				<div className='flex justify-between'><div>Open</div> <div>{currentData['open']}</div></div>
				<div className='flex justify-between'><div>High</div> <div>{currentData['high']}</div></div>
				<div className='flex justify-between'><div>Close</div> <div>{currentData['close']}</div></div>
				<div className='flex justify-between'><div>Volume</div> <div>{currentData['volume']}</div></div>
				<div className='flex justify-between'><div>% Change</div> <div>{currentData['change']} %</div></div>
			</div>}
		</div>
	);
};
